<script language="javascript" type="text/javascript">
    var output = document.getElementById("output");
    var form1 = {
        "TXT": 0
    };
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
    //在javascript中，用下面的代码应能正确调用到JZKWrite和JZKWrite函数。
document.write("<OBJECT ID=\"SSCARD\" WIDTH=\"0\" HEIGHT=\"0\" CLASSID=\"CLSID:2A6322AE-61E7-32F7-9A2E-810B55AF4581\"></OBJECT>");
function ClickBt(cs) 
{  //按钮公共处理函数
	form1.TXT.value="";
	if (cs=="读卡") 
		form1.TXT.value=SSCARD.JZKRead(1);
	else if (cs=="退卡") 
		form1.TXT.value=SSCARD.JZKWrite("","","","","","","","");
	else if (cs=="印写卡") 
		form1.TXT.value=SSCARD.JZKWrite(card_info.value,
		tableInfo[0],
		tableInfo[1],
		tableInfo[2],
		tableInfo[3],
		tableInfo[4],
		tableInfo[5],
		tableInfo[6]);
}

//////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
		
var tableInfo = new Array()
function DoJob(op_code) 
{
	tableInfo.splice(0,tableInfo.length);
    var tableObj = document.getElementById("para");
    for (var i = 1; i < tableObj.rows.length; i++) 
	{    //遍历Table的所有Row
		var rowinfo = "";
        for (var j = 1; j < tableObj.rows[i].cells.length; j++) 
		{   //遍历Row中的每一列	
            var item = tableObj.rows[i].cells[j].childNodes[0].value;   //获取Table中单元格的内容
            if(item != "")
			{
				if(j!=1)
					item = "|"+item;
				rowinfo+=item;
			}
			else
			{
				continue;
			}
        }
		if(i == tableObj.rows.length - 1)
		{
			rowinfo = photoinfo + rowinfo;
		}
		//alert(rowinfo);
        tableInfo.push(rowinfo);
    }
	//return;
    form1.TXT = document.getElementById("output");
    SSCARD.__JZK_PrintToImage(print_to_img.checked ? 1 : 0);
    SSCARD.__JZK_NO_ReadWrite(do_not_wr_card.checked ? 1 : 0);
	ClickBt(op_code);
	SSCARD.__JZK_PrintToImage(0);
	SSCARD.__JZK_NO_ReadWrite(0);
}
</script>
